import React, { ReactElement } from 'react';
import HomeIcon from '../../assets/icons/HomeIcon.svg';
import { CONFIRM_BUTTON } from './ConfirmButton';
import { DATE_PICKER } from './Datepicker';
import { MONTHLY_AMOUNT } from './MonthlyAmount';
import { TOTAL_AMOUNT } from './TotalAmount';

export const SAVING_CARD = (): ReactElement => {
  return (
    <div
      style={{
        height: '60%',
        width: '40%',
        // border: '2px solid ',
        background: ' #FFFFFF',
        boxShadow: '0px 16px 32px rgba(30, 42, 50, 0.08)',
        borderRadius: 8,
        padding: '2%',
      }}
    >
      <div
        style={{ display: 'flex', flexDirection: 'row', alignItems: 'left' }}
      >
        <div>
          <img
            src={HomeIcon}
            alt="Home Icon"
            style={{
              width: '100px',
              height: '64px',
            }}
          />
        </div>

        <div>
          <span
            style={{
              fontFamily: 'Rubik',
              fontWeight: 500,
              fontSize: 24,
              lineHeight: '120%',
              color: '#1E2A32',
              fontStyle: 'normal',
            }}
          >
            Buy a house
          </span>
          <br />
          <span
            style={{
              fontFamily: 'Work Sans',
              // fontWeight: 500,
              fontSize: 16,
              lineHeight: '150%',
              color: '#708797',
              fontStyle: 'normal',
            }}
          >
            Saving goal
          </span>
        </div>
      </div>
      <TOTAL_AMOUNT />
      <DATE_PICKER />
      {/*<MONTHLY_AMOUNT months={45} amount={23000} FinalDate={'October 2023'} />
      <CONFIRM_BUTTON /> */}
    </div>
  );
};
